-- Table structure for app_wechat_openid
-- ----------------------------
DROP TABLE IF EXISTS `app_wechat_openid`;
CREATE TABLE `app_wechat_openid`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '用户ID',
  `openid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'openid',
  `scope` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '授权方式',
  `add_accredit` datetime(0) NULL DEFAULT NULL COMMENT '上次授权时间',
  `refresh_token` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '刷新access_token使用',
  `refresh_token_time` int(10) NOT NULL COMMENT 'refresh_token获取数据有效期30天',
  `nickname` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '微信用户昵称',
  `sex` int(1) NOT NULL COMMENT '用户的性别，值为1时是男性，值为2时是女性，值为0时是未知',
  `province` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '省份',
  `city` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '城市',
  `country` varchar(28) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '国家，如中国为CN',
  `headimgurl` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户头像，最后一个数值代表正方形头像大小（有0、46、64、96、132数值可选，0代表640*640正方形头像），用户没有头像时该项为空。若用户更换头像，原有头像URL将失效。',
  `privilege` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户特权信息，json 数组，如微信沃卡用户为（chinaunicom）',
  `unionid` int(11) NOT NULL COMMENT '只有在用户将公众号绑定到微信开放平台帐号后，才会出现该字段。',
  `autonym` tinyint(1) NULL DEFAULT 0 COMMENT '认证状态，0为正常，1为锁定',
  `status` tinyint(1) NULL DEFAULT 0 COMMENT '状态，0为正常，1为锁定',
  `isdel` tinyint(1) NULL DEFAULT 0 COMMENT '软删除  0正常  1删除',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `openid`(`openid`) USING BTREE,
  UNIQUE INDEX `uid`(`uid`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户微信信息表' ROW_FORMAT = Dynamic;

